package problems;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.Collections;

public class minDeletionsToMakeUniqueCount {
    public static void main(String[] args) {
        String input = "";
        //System.out.println(minDeletions(input));
        int a=65;
        char c=(char)a;
        System.out.println(c);
        char[][] board = new char[10][];
        int row = board[0].length;
        int col = board.length;
    }
    public static int minDeletions(String input) {

        //count all chars count and store it in array of 26 chars
        Integer [] charCounts = new Integer[26];
        Arrays.fill(charCounts, 0);

        for (int i = 0; i < input.length() ; i++) {
            int index = input.charAt(i)-'a';
            int count = charCounts[index];
            charCounts[index] = count + 1;
        }
        Arrays.sort(charCounts, Collections.reverseOrder());
//     String input = "aababbcc";
        // 3 2 1
        int deletions=0;
        //iterate from left to right and if count is same then reduce
        for (int i = 0; i < charCounts.length-1 ; i++) {
            for (int j = i+1; j < charCounts.length ; j++) {
                if (charCounts[i]>0 && 0==charCounts[i].compareTo(charCounts[j])){
                    int count = charCounts[j];
                    charCounts[j] = count - 1;
                    deletions++;
                }else
                    break;
            }
        }
        return deletions;
    }
}